;; **
;;; ## Daily Expansion
;; **

;; @@
(defn plot-size-expansion [coll]
  (let [result (zipmap coll (map #(nw-size % t0 tmax :evolution) coll))
       dat {:day (mapcat (comp range count) (vals result))
            :count (mapcat val result)
            :label(mapcat (fn [[k v]] (repeat (count v) (element-name k))) result) }]
  
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :label :color :label}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Size daily expansion"])]
      {:width 7 :height 6})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;overall-network/plot-size-expansion</span>","value":"#'overall-network/plot-size-expansion"}
;; <=

;; @@
(for [c (partition 2 2 [] contacts)]
  (plot-size-expansion c))
