;; **
;;; # Total Degree
;; **

;; **
;;; ## Overall
;; **

;; @@
(table/table-view (map (fn [[k v]] [(element-name k) v])  (total-degree contacts t0 tmax :overall)) :columns ["Label" "Total degree"] )
;; @@

;; **
;;; ## Hourly Average
;; **

;; @@
(table/table-view 
  (map 
    (fn [[k v]] (concat [(element-name k)] 
                        (format-to-table-view v))) 
    (zipmap contacts (map #(total-degree % t0 tmax :hourly) contacts))) 
  :columns table-columns )
