;; **
;;; ## Daily Expansion 
;; **

;; @@
(defn plot-td-expansion [coll]
  (let [result (zipmap coll (map #(total-degree % t0 tmax :evolution) coll))
       dat {:day (mapcat (comp range count) (vals result))
            :count (mapcat val result)
            :label(mapcat (fn [[k v]] (repeat (count v) (element-name k))) result) }]
  
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :label :color :label}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "total daily expansion"])]
      {:width 7 :height 6})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;overall-network/plot-td-expansion</span>","value":"#'overall-network/plot-td-expansion"}
;; <=

;; @@
(for [c (partition 2 2 [] contacts)]
  (plot-td-expansion c))
;; @@
